const cultures = Array.from(new Set(artisansData.map((a) => a.culture)));

const ArtisanPage: React.FC = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedCulture, setSelectedCulture] = useState("");
  const [verifiedOnly, setVerifiedOnly] = useState(false);

  const filteredArtisans = artisansData
    .filter(
      (artisan) =>
        artisan.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        artisan.biography.toLowerCase().includes(searchTerm.toLowerCase()) ||
        artisan.specialty.toLowerCase().includes(searchTerm.toLowerCase())
    )
    .filter(
      (artisan) => selectedCulture === "" || artisan.culture === selectedCulture
    )
    .filter((artisan) => !verifiedOnly || artisan.verified);

  return (
    <div className="min-h-screen bg-primary-800 pt-16">
      <div className=" mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div className="flex flex-col md:flex-row gap-8">
          {/* Filters */}
          <div className="w-full md:w-64 bg-white bg-opacity-30 p-6 rounded-lg shadow-soft h-fit mb-8 md:mb-0">
            <div className="mb-6">
              <label className="block text-sm font-medium text-white mb-2">
                Search
              </label>
              <div className="relative">
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <Search size={18} className="text-neutral-400" />
                </div>
                <input
                  type="text"
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                  placeholder="Search artisans, specialties..."
                  className="block w-full pl-10 pr-3 py-2 border-0 rounded-md focus:ring-2 focus:ring-primary-500 placeholder:text-neutral-400"
                />
              </div>
            </div>
            <div className="mb-6">
              <label className="block text-sm font-medium text-white mb-2">
                Culture
              </label>
              <select
                value={selectedCulture}
                onChange={(e) => setSelectedCulture(e.target.value)}
                className="w-full p-2 border border-neutral-300 rounded-md focus:ring-2 focus:ring-primary-500 focus:border-primary-500"
              >
                <option value="">All Cultures</option>
                {cultures.map((culture) => (
                  <option key={culture} value={culture}>
                    {culture}
                  </option>
                ))}
              </select>
            </div>
            <div className="mb-6">
              <label className="flex items-center text-sm font-medium text-white">
                <input
                  type="checkbox"
                  checked={verifiedOnly}
                  onChange={() => setVerifiedOnly((v) => !v)}
                  className="h-4 w-4 text-primary-600 focus:ring-primary-500 border-neutral-300 rounded mr-2"
                />
                Verified Only
              </label>
            </div>
            <button
              className="w-full bg-neutral-100 hover:bg-neutral-200 text-neutral-800 font-medium py-2 rounded-md transition-colors"
              onClick={() => {
                setSearchTerm("");
                setSelectedCulture("");
                setVerifiedOnly(false);
              }}
            >
              Reset Filters
            </button>
          </div>
          {/* Artisans Grid */}
          <div className="flex-1">
            {filteredArtisans.length === 0 ? (
              <div className="text-center py-12">
                <p className="text-neutral-100 text-lg">
                  No artisans found matching your filters.
                </p>
                <button
                  onClick={() => {
                    setSearchTerm("");
                    setSelectedCulture("");
                    setVerifiedOnly(false);
                  }}
                  className="mt-4 text-primary-200 hover:text-primary-100 font-medium"
                >
                  Clear all filters
                </button>
              </div>
            ) : (
              <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
                {filteredArtisans.map((artisan) => (
                  <motion.div
                    key={artisan.id}
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5 }}
                    className="bg-white bg-opacity-50 rounded-lg overflow-hidden shadow-medium"
                  >
                    <div className="relative">
                      <img
                        src={artisan.imageUrl}
                        alt={artisan.name}
                        className="w-full h-72 object-cover"
                      />
                      {artisan.verified && (
                        <div className="absolute bottom-3 right-3 bg-primary-500 text-white rounded-full px-2 py-1 flex items-center text-sm">
                          <CheckCircle size={14} className="mr-1" />
                          Verified
                        </div>
                      )}
                    </div>
                    <div className="p-5">
                      <h1 className="text-2xl font-semibold text-neutral-800 mb-2">
                        {artisan.name}
                      </h1>
                      <div className="flex items-center mb-2 text-neutral-600">
                        <MapPin size={14} className="mr-1" />
                        <span className="text-sm">{artisan.location}</span>
                      </div>
                      <p className="text-neutral-600 text-sm mb-3">
                        {artisan.biography}
                      </p>
                      <div className="flex items-center mb-4">
                        <span className="text-xs font-medium bg-secondary-100 text-secondary-700 px-2.5 py-0.5 rounded-full">
                          {artisan.culture}
                        </span>
                        <span className="ml-2 text-xs font-medium bg-primary-100 text-primary-700 px-2.5 py-0.5 rounded-full">
                          {artisan.specialty}
                        </span>
                      </div>
                    </div>
                  </motion.div>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ArtisanPage;
